<blockquote>“It was in the 1950s that the brilliant architect Le Corbusier (“Le Corbu” to his friends) began to design a new kind of building with austere lines, marked geometry and the absence of any decorative element that might lighten the massive dimensions.”</blockquote>
&nbsp;
<h3 style="text-align: center;">A bit about architecture</h3>
Over the next 20 years, his idea would find its way into the designs of figures of the stature of Mies van der Rohe, Alvar Aalto and Miguel Fisac. This kind of “architecture on steroids” is still making its presence felt in huge buildings the length and breadth of the planet.

There is the Unité d’Habitation de Marseille by Le Corbusier himself; the Torres Blancas in Madrid by Saenz de Oiza, (Fisac’s impressive Pagoda was demolished in 1999); La Fábrica and Walden 7 in Barcelona, both by Ricardo Bofill; the famous Trellick Tower in London; Habitat 67, in Montreal; and the no less spectacular Geisel Library in San Diego, Boston City Hall and Freeway Park in Seattle.

In all these creations the overwhelming presence of an emphatic material stands out: exposed or raw concrete – in French, betón brut. This “brut” ended up giving its name to the architectural movement we know today as Brutalism. Famous for the sheer size of its buildings and the polarized reactions they generate (people love them or hate them), the ripples of this architectural school resonate, decades later, beyond the enormous concrete walls that characterize the style. Specifically, we see the echoes on publicity materials and on many of the screens we look at every day. In fact, in the absence of pixelated concrete, more and more visuals are opting to throw information in the rough, just as it lands, splat, on the interface or the poster of the moment.

&nbsp;
<h3 style="text-align: center;">Redesigning Brutalism in 2D</h3>
